import React from 'react';

function Contact() {
  return (
    <section id="contact" className="py-16 px-6">
      <div className="max-w-3xl mx-auto text-center">
        <h2 className="text-3xl font-bold mb-4">Contact Us</h2>
        <form className="mt-6 grid grid-cols-1 gap-4">
          <input type="text" placeholder="Your Name" className="p-3 border rounded" />
          <input type="email" placeholder="Your Email" className="p-3 border rounded" />
          <textarea rows="4" placeholder="Message" className="p-3 border rounded"></textarea>
          <button className="bg-pink-600 text-white py-3 px-6 rounded hover:bg-pink-700">Send Message</button>
        </form>
      </div>
    </section>
  );
}

export default Contact;
